import style from './navbar.module.css'
import logoName from '../../img/BULLDEV-logo .png';

function Navbar(){
	return(
		<nav className={style.navbar}>
          <div className={style.logo}>
            <img src={logoName} alt="logo"/>
          </div>
          <div className={style.links}>
            <ul>
              <li>HOME</li>
              <li>BLOG</li>
              <li>CONTATO</li>
            </ul>
          </div>
    </nav>

		)
}

export default Navbar;
